'''Telemor'''  là nhà mạng [[viễn thông]] có trụ sở chính tại [[Đông Timor]]. 
Đây là thị trường thứ 7 của [[Viettel]] đầu tư ra nước ngoài. Mạng di động đến từ Việt Nam đồng thời có lãi sau 6 tháng, đây là kết quả nhanh nhất mà [[Viettel]] có được từ trước giờ khi đầu tư ra nước ngoài<ref>http://vneconomy.vn/cuoc-song-so/4-chieu-de-viettel-len-so-1-tai-dong-timor-20151027115456483.htm</ref>. Chính vì thế, Telemor đã trở thành nhà mạng được ưa chuộng số 1 tại đất nước này.<ref>{{chú thích báo|title=Đăng ký 4G Viettel|url=https://datasimviettel.net/Dang-ky-4G-Viettel/}}</ref>

Telemor cũng là nhà mạng chính thức cung cấp hạ tầng 4G cho thị trường này<ref>http://www.sggp.org.vn/telemor-thuong-hieu-viettel-tai-dong-timor-chinh-thuc-cung-cap-4g-458914.html</ref>.

